import Link from 'next/Link';

const Nav = () => {
  return(
    <div>
      <Link href="/">
        <span className="home">Home</span>
      </Link>
      <Link href="/about">
        <span>About</span>
      </Link>

      <style jsx>{`
        .home {
          font-size: 2rem;
          padding: 0 1rem;
        }
      `}</style>
    </div>
  )
}

export default Nav;
